	namespace
	{
		const float split_points[NUM_BESSEL_ORDERS] = {
			0.0f
			, 0.0f
			, 1.3455437f
			, 0.572431f
		};
	}

	namespace
	{
		const float further_split_points[NUM_BESSEL_ORDERS] = {
			0.0f
			, 0.0f
			, 0.037205428f
			, 0.15154193f
		};
	}

	namespace
	{
		const float two_order_inv[NUM_BESSEL_ORDERS] = {
			1.0f
			, 0.5f
			, 0.25f
			, 0.16666667f
		};
	}

	float fast_jn_norm(const size_t n, const float x)
	{
		if (n >= NUM_BESSEL_ORDERS)
			return 0.0f;
		if (x < split_points[n])
		{
			return split_cubics[n][x < further_split_points[n]](x);
		}
		// Find via math; works up to order 31
		const float (&h)[NUM_POSITIVE_BESSEL_ZEROS_PER_ORDER] = bessel_harmonics_by_order[n];
		auto get_zero = [&h](const size_t m)
		{
			const size_t idx(!m);
			const size_t hidx[2]{ m - 1, 0 };
			const float result[2]{ h[hidx[idx]], 0.0f };
			return result[idx];
		};
		constexpr const float z01 = 2.4048254f;
		constexpr const float z01overpi = static_cast<float>(2.404825557695773 / 3.1415926535897932384626433832795);
		constexpr const float adj[2] = { 0.0f, 0.1f * z01 };
		constexpr const float overdiv = 1.0f / 20.0f;
		const float hn1(bessel_harmonics_by_order[n][0]);
		const float p((x - hn1));
		const float adj2[2] = { static_cast<float>(n > 11 && x > hn1), overdiv * p * (2.0f - p * two_order_inv[n]) };
		const float intermediates[2] = { std::floorf(z01overpi * (x - hn1 + adj[static_cast<size_t>(n == 0)]) - adj2[static_cast<size_t>(n > 11 && x > hn1 && x < hn1 + (n << 1))]) + 1.0f, 0.0f };
		const size_t initial = intermediates[static_cast<size_t>(intermediates[0] < 0.0f)];
		const size_t lo = initial - static_cast<size_t>((get_zero(initial)) > x);
		if (lo >= NUM_POSITIVE_BESSEL_ZEROS_PER_ORDER)
			return 0.0f;
		return cubics_by_order[n][lo](x);
	}
